await image.loadPixels()
const colored = image.clone()
image.edgeDetection()


const CLUSTER_COUNT = 4
// const INCLUDE_STARTING_POINTS = true
const MIN_LUMINANCE = 240
// number of sample points
const NUMBER_POINTS = 1000
// radians
const MAX_ANGLE = 1.8
// how fast to move from point to dest in relaxation 0-1
const INTERPOLATION_STEP = 1
// min distance to next point for drawing curves
const MAX_NEIGHBOR_DIST = 30

const WIDTH = image.width
const HEIGHT = image.height

const rng = Random.xorshift()
// const rng = xorshift()
// let s = Svg.create({ width: WIDTH, height: HEIGHT })

const canvas = Canvas.create({ width: WIDTH, height: HEIGHT, renderMode: 'svg' })

// generate n random points based on luminance
let points: Vector<2>[] = []
const colors = []
for (let i = 0; i < NUMBER_POINTS; i++) {
  const x = rng.integer(WIDTH - 1)
  const y = rng.integer(HEIGHT - 1)
  const color = image.get(x, y)
  if (color.luminance() > rng.integer(MIN_LUMINANCE)) {
    colors.push(color)
    points.push(vec(x, y))
  } else {
    i--
  }
}

for (const p of points) {
  canvas.circle(p, 4)
}


function updatePoints() {
  let vor = Voronoi.create(points, [0, 0, WIDTH, HEIGHT])
  vor.weightedStippling((x, y) => {
    return image.get(x, y).luminance()
  }, INTERPOLATION_STEP)
}


const means = new KMeans(colors, CLUSTER_COUNT)
const clusters = means.clusters()

const COLORS = []
for (const centroid of means.centroids()) {
  const c = vec(centroid).round()
  COLORS.push(color(c))
}
