console.log(groupedPoints)

function drawLine(group: number) {
  const points = groupedPoints[group]
  const map = new SpatialMap(WIDTH, HEIGHT, 50, points)
  const visited = new Array(points.length).fill(false)

  // get next neighboring point
  const getNext = (linePoints: Vector<2>[], i: number) => {
    const ni = [...map.nearestNeighbors(i, MAX_NEIGHBOR_DIST)]
      .filter(([i]) => !visited[i])
      .filter(([i]) => {
        const s = points[i]
        if (linePoints.length > 2) {
          const p1 = points[linePoints.length - 2]
          const p2 = points[linePoints.length - 1]
          const v1 = p2.clone().sub(p1)
          const v2 = s.clone().sub(p1)
          const angle = Math.acos(v2.dot(v1) / (v1.mag() * v2.mag()))
          if (angle > MAX_ANGLE) return false
        }
        return true
      })
      .sort((a, b) => a[2] - b[2])
      .map((a) => a[0])
    return ni[0]
  }

  // draw curves
  for (let i = 0; i < points.length; i++) {
    if (visited[i]) continue

    const linePoints: Vector<2>[] = []
    let ni = getNext(linePoints, i)
    while (typeof ni !== 'undefined') {
      const s = points[ni]
      linePoints.push(s)
      visited[ni] = true
      ni = getNext(linePoints, ni)
    }

    // minimum of 2 points for a curve
    if (linePoints.length < 3) continue

    // canvas.path({ smooth: true, stroke: COLORS[group] }).add(linePoints)
  }

}

for (let i = 0; i < groupedPoints.length; i++) {
  drawLine(i)
}

